spring: 
  profiles: 
    active: -dev
---
server: 
  port: 9001

spring: 
  profiles: dev
  application: servicecloud-config-eureka-client

eureka: 
  instance: 
    hostname: server9001
  client: 
    register-with-eureka: false
    fetch-registry: false
    service-url: 
      defaultZone: http://localhost:9001/eureka/